

require.config({
    paths: {
        "jquery": "jquery/jquery-1.9.0.min",
        "base": "ligerUI/js/core/base",
        "ligerui": "ligerUI/js/ligerui.min",
        "ligerGrid": "ligerUI/js/plugins/ligerGrid",
        "ligerResizable": "ligerUI/js/plugins/ligerResizable",
        "ligerDrag": "ligerUI/js/plugins/ligerDrag",
        "table2excel": "excel/table2excel",
        "FileSaver": "excel/FileSaver.min",
        "tableexport": "excel/tableexport",
        "jszip": "excel/jszip",
        "xlsx": "excel/xlsx",
        "xlsxloader": 'excel/xlsx-loader',
        "CustomersData": "CustomersData"
    },
    shim: { 
        'ligerui':['jquery'],// 依赖jquery
        'ligerGrid': ['jquery', 'ligerui'],
        'ligerResizable': ['jquery', 'ligerui'],
        'ligerDrag': ['jquery', 'ligerui'],
        'tableexport': ['xlsx'],
        xlsx: {// 加载非AMD规范的JS文件
            exports: 'XLSX',
            deps: ['xlsxloader']
        },
        table2excel: {
            exports: 'table2excel'
        }
    }
});


define(['jquery', 'CustomersData', 'ligerui', 'tableexport'], function ($, CustomersData) {

    var g;

    var base = "data:image/jpeg;base64,";
    $(function () {
        g = $("#maingrid").ligerGrid({
            columns: [
            { display: '主键', name: 'CustomerID', align: 'left' },
            { display: '公司名', name: 'CompanyName', minWidth: 60 },
            { display: '联系名1', name: 'ContactName', width: 111, align: 'left' },
            { display: '联系名2', name: 'ContactName', align: 'left' },
            { display: '联系名3', name: 'ContactName', align: 'left' },
            { display: '联系名4', name: 'ContactName', align: 'left', frozen: true },
            {
                display: "联系名5", name: "ContactName", width: "150", align: "center", render: function (rowdata, rowindex, value) {
                    if (base) {
                        return "<img style='width:100px;height:50px;' src='" + base + "'/>";
                    } else {
                        return "";
                    }

                }
            },
            { display: '联系名6', name: 'ContactName', align: 'left', frozen: true },
            { display: '城市', name: 'City', width: 200 }
            ], data: CustomersData.getData(), pageSize: 20, sortName: 'CustomerID',
            width: 800, height: '98%', checkbox: false, rownumbers: true,
            fixedCellHeight: false
        });
        $("#pageloading").hide();
    });

    function table2excel() {
        $("#maingrid").tableExport({
            title: "excel标题名称",
            fileName: "excel导出文件名称",
            islageruigrid: true, // 是否基于ligerui
            css: ["/css/ligerui_grid_export_excel.css"],
            ligerui: {
                isGetAll: true,
                gridInstance: g,
                serialNumberWidth: "50"
            },
            frozen: { c: 1, r: 2 } //冻结列 (c:列 r:行)
        });
    }

    return {
        table2excel: table2excel
    };
});